/*****     Listeners to handle popstate and to rebuild on screen resize     *****/

window.addEventListener('resize', rebuildScreen);
window.addEventListener('popstate', handleStateChange);
function handleStateChange(event) {
  var poppedLang = event.state.lang;
  if (poppedLang != lang) {
    //Language change - no book change
    lang = poppedLang;
    if (lang == "he") {
      switchToHebrew();
    } else if (lang == "en") {
      switchToEnglish();
    }
    rebuildScreen();
    changePageTitle(event.state.title);
    return;
  }
  var poppedOpenIds = event.state.openIds;

  //Close currently open books not in popped state
  var toBeClosed = svg.selectAll(".open.book").filter(function (d) {
    return poppedOpenIds.indexOf(d.id) == -1;
  });

  //Open popped books not in currently open books
  var toBeOpened = svg.selectAll(":not(.open).book").filter(function (d) {
    return poppedOpenIds.indexOf(d.id) > -1;
  });

  //console.log("handleStateChange", poppedOpenIds, toBeClosed, toBeOpened);

  toBeClosed.each(closeBook);
  toBeOpened.each(openBook);
  changePageTitle(event.state.title);
}

//Rebuild screen geometry, without state change
function rebuildScreen() {
  var openBooks = [];
  svg.selectAll(".open.book").each(function (d) {
    openBooks.push(d.id);
  });
  external_d3_default().selectAll("svg").remove();
  booksFocused = 0;
  buildScreen(openBooks, currentScheme);
}

/*****          Book Collections            *****/

function buildBookCollection(books, klass, position, offset, cnxOffset) {
  //Lays out and labels book collection

  var q = books.length;
  var totalSpacer = bookSpacer * (q - 1);
  var effectiveWidth = w - totalSpacer;
  var currentLeft = 0; //used for LTR
  var previousLeft = w + bookSpacer; //used for RTL
  var totalBookLength = totalBookLengths(books);
  svg.select("#" + klass + "-collection").selectAll("rect.book").data(books).enter().append("rect").attr("id", function (d) {
    d.id = toId(d.book);
    return d.id;
  }).each(function (d) {
    d["collection"] = klass;
    d["position"] = position;
  }).attr("class", function (d) {
    return klass + " book " + toId(d["section"]) + " " + d.id;
  }).attr("y", function (d) {
    d["y"] = offset;
    return d["y"];
  }).attr("width", function (d) {
    d["base_width"] = d["length"] / totalBookLength * effectiveWidth;
    return d["base_width"];
  }).attr("height", bookHeight).attr("x", function (d) {
    if (isEnglish()) {
      d["base_x"] = currentLeft;
      currentLeft += bookSpacer + d["length"] / totalBookLength * effectiveWidth;
    } else {
      d["base_x"] = previousLeft - d["base_width"] - bookSpacer;
      previousLeft = d["base_x"];
    }
    return d["base_x"];
  }).attr("cx", function (d) {
    d["base_cx"] = Number(this.getAttribute("x")) + Number(this.getAttribute("width")) / 2;
    return d["base_cx"];
  }).attr("cy", function (d) {
    return Number(this.getAttribute("y")) + cnxOffset;
  }).attr("section", function (d) {
    return toId(d["section"]);
  }).attr("color", function (d) {
    var cat = position == "top" ? topCat : bottomCat;
    if (categories[cat].colorByBook) {
      return colors(d.id);
    } else {
      return colors(selectBook(d.id).attr("section"));
    }
  }).attr("fill", function (d) {
    return selectBook(d.id).attr("color");
  }).each(addAxis).on("mouseover", mouseover_book).on("mouseout", mouseout_book).on("click", recordOpenBook);
  svg.selectAll("#" + klass + "-collection .book").on("mouseover.tooltip", function () {
    bookTooltip.style("display", null);
  }).on("mouseout.tooltip", function () {
    bookTooltip.style("display", "none");
  }).on("mousemove.tooltip", function (d) {
    var xPosition = external_d3_default().mouse(this)[0];
    var yPosition = external_d3_default().mouse(this)[1] - 35;
    bookTooltip.select("text").text(isEnglish() ? d.book : d.heBook);
    var bbox = bookTooltip.select("text").node().getBBox();
    bookTooltip.select("rect").attr("width", bbox.width + 30);
    bookTooltip.attr("transform", "translate(" + xPosition + "," + yPosition + ")");
  });
  buildBookLabels(books, klass, position);
}
function buildBookLabels(bks, klass, position) {
  var cat = position == "top" ? topCat : bottomCat;
  if (categories[cat].labelBySection) {
    buildBookLabelsBySection(bks, klass, position);
    return;
  }
  var anchor = "start";
  var offset = 0;
  var dx = "-.8em";
  var dy = "-.8em";
  if (position == "bottom") {
    anchor = "end";
    offset = bookHeight * 2;
    dx = "0";
    dy = "0";
  }
  if (klass == "Tanakh") {
    bks = bks.filter(isNotTwelve);
  }
  svg.select("#" + klass + "-collection").selectAll("text.title").data(bks).enter().append("text").attr("class", function (d) {
    d.id = toId(d.book);
    return "title " + toId(d["section"]) + " " + d["id"];
  }).text(bookLabel).style("text-anchor", anchor).attr("fill", function (d) {
    return selectBook(d.id).attr("color");
  }).attr("x", function (d) {
    return Number(selectBook(d.id).attr("cx"));
  }).attr("y", function (d) {
    return Number(selectBook(d.id).attr("y")) + offset;
  }).attr("dx", dx).attr("dy", dy).attr("transform", function (d) {
    return "rotate(-35, " + this.getAttribute("x") + "," + this.getAttribute("y") + ")";
  }).on("mouseover", mouseover_book).on("mouseout", mouseout_book).on("click", recordOpenBook);
  if (klass == "Tanakh") {
    var twelveText = isEnglish() ? "The Twelve Prophets" : "תרי עשר";
    var twelveNode = svg.select("#Tanakh-collection").append("text").attr("class", "title twelve Prophets").attr("fill", function (d) {
      return colors("Prophets");
    }).text(twelveText);
    if (isEnglish()) {
      twelveNode.attr("x", Number(svg.select("#Hosea").attr("cx"))).attr("y", Number(svg.select("#Hosea").attr("y")) - 12);
    } else {
      twelveNode.attr("x", Number(svg.select("#Habakkuk").attr("cx"))).attr("y", Number(svg.select("#Habakkuk").attr("y")) - 12);
    }
  }
  function bookLabel(d) {
    var label = isEnglish() ? d["book"] : d["heBook"];
    label = label.replace("Mishneh Torah, ", "").replace("Shulchan Arukh, ", "").replace("Jerusalem Talmud ", "").replace("משנה תורה, ", "").replace("שולחן ערוך, ", "").replace("תלמוד ירושלמי ", "");
    return label;
  }
}
function buildBookLabelsBySection(bks, klass, position) {
  var anchor = "start";
  var offset = 0;
  var dx = "-.8em";
  var dy = "-.8em";
  if (position == "bottom") {
    anchor = "end";
    offset = bookHeight * 2;
    dx = "0";
    dy = "0";
  }
  var prevSection = null;
  var sections = [];
  for (var i = 0; i < bks.length; i++) {
    if (prevSection != bks[i].section) {
      sections.push({
        section: bks[i].section,
        firstId: toId(bks[i].book)
      });
    }
    sections[sections.length - 1].lastId = toId(bks[i].book);
    prevSection = bks[i].section;
  }
  svg.select("#" + klass + "-collection").selectAll("text.title").data(sections).enter().append("text").attr("class", function (d) {
    return "title " + toId(d["section"]);
  }).text(function (d) {
    return isEnglish() ? d["section"] : (external_Sefaria_default()).terms[d["section"]].he;
  }).style("text-anchor", anchor).attr("fill", function (d) {
    return colors(toId(d["section"]));
  }).attr("x", function (d) {
    var firstX = Number(selectBook(d.firstId).attr("cx"));
    var lastX = Number(selectBook(d.lastId).attr("cx"));
    return isEnglish() ? firstX + (lastX - firstX) / 2 : lastX + (firstX - lastX) / 2;
  }).attr("y", function (d) {
    return Number(selectBook(d.firstId).attr("y")) + offset;
  }).attr("dx", dx).attr("dy", dy).attr("transform", function (d) {
    return "rotate(-35, " + this.getAttribute("x") + "," + this.getAttribute("y") + ")";
  });
}
function addAxis(d) {
  var orient = d.position;
  var ticks, y;
  var y = orient == "top" ? topOffsetY + 5 : bottomOffsetY + 5;
  if (categories[d.collection].talmudAddressed) {
    ticks = sefaria_d3_default().talmudRefTicks(d);
    d.scale = sefaria_d3_default().textScale(isEnglish() ? "ltr" : "rtl", d.base_x, d.base_x + d.base_width, d, "talmud");
  } else {
    ticks = sefaria_d3_default().integerRefTicks(d);
    d.scale = sefaria_d3_default().textScale(isEnglish() ? "ltr" : "rtl", d.base_x, d.base_x + d.base_width, d, "integer");
  }
  d.s = sefaria_d3_default().scaleNormalizationFunction(d.scale);
  d.axis = external_d3_default().svg.axis().orient(orient).scale(d.scale).tickValues(ticks).tickFormat(function (ref) {
    return ref.split(/(\d.*)/)[1];
  }); // Only show numerical portion of ref in ticks

  d.axis_group = svg.select("#" + d.collection + "-collection").append("g").attr("class", "axis " + d.id).attr("transform", "translate(0," + y + ")").style("display", "none").call(d.axis);
}
function updateAxis(d) {
  var x = "new_x" in d ? d.new_x : d.base_x;
  var width = "new_width" in d ? d.new_width : d.base_width;
  d.scale.rangePoints(isEnglish() ? [x, x + width] : [x + width, x]);
  d.axis_group.call(d.axis);
}

/*****       Axis Brushing Selection         *****/

function activateBrush(d) {
  svg.select("#" + d.collection + "-collection").append("g").attr("class", "brush").each(function () {
    external_d3_default().select(this).call(brushes[d.collection] = external_d3_default().svg.brush().x(d.scale).on("brushstart", brushstart).on("brush", brushmove).on("brushend", brushend));
  }).selectAll("rect").attr("y", d.y).attr("height", bookHeight);
  brushes[d.collection]["book"] = d.id;
}
function removeBrush(d) {
  brushes[d.collection].clear();
  brushmove();
  svg.select("#" + d.collection + "-collection .brush").remove();
  brushes[d.collection] = null;
}
function brushstart() {
  (external_d3_default()).event.target.b_active = true;
  svg.classed("selecting", true);
  external_Sefaria_default().track.exploreBrush((external_d3_default()).event.target.book);
}
function brushmove() {
  //We are assuming that source is bottom and target is top
  svg.selectAll(".preciseLink").classed("selected", function (d) {
    if (!brushes.hasOwnProperty(topCat) || brushes[topCat] == null) {
      return brushes[bottomCat].extent()[0] <= d.sourcex && d.sourcex <= brushes[bottomCat].extent()[1];
    } else if (!brushes.hasOwnProperty(bottomCat) || brushes[bottomCat] == null) {
      return brushes[topCat].extent()[0] <= d.targetx && d.targetx <= brushes[topCat].extent()[1];
    } else {
      // 2 brushes
      return (brushes[bottomCat].empty() && !brushes[bottomCat]["b_active"] || brushes[bottomCat].extent()[0] <= d.sourcex && d.sourcex <= brushes[bottomCat].extent()[1]) && (brushes[topCat].empty() && !brushes[topCat]["b_active"] || brushes[topCat].extent()[0] <= d.targetx && d.targetx <= brushes[topCat].extent()[1]);
    }
  });
}
function brushend() {
  (external_d3_default()).event.target.b_active = false;
  svg.classed("selecting", brushes.hasOwnProperty(topCat) && brushes[topCat] != null && !brushes[topCat].empty() || brushes.hasOwnProperty(bottomCat) && brushes[bottomCat] != null && !brushes[bottomCat].empty());
}

